#pragma once

#include<core/preprocessor/uint8_if.h>
#include<core/preprocessor/bool_or.h>
#include<core/preprocessor/uint8_equal.h>
#include<core/preprocessor/uint8_is_zero.h>
#include<core/preprocessor/uint8_less.h>
#include<core/preprocessor/uint8_sub_n.h>
#include<core/preprocessor/uint8_add_n.h>
#include<Core/preprocessor/uint8_div.h>

//    for(...)       ->   A3D_PP_RANGE_CALL
//       call(...)   ->   A3D_PP_RANGE_CALL
//			for( uint i = start; i!= end; i++)
//				inner_call(i, end - i- 1, others... )

//if(  step == 0)
//  return;
//else  
//  A3D_PP_RANGE_INNER_CALL_CMP(...)
#define A3D_PP_RANGE_INNER_CALL(start, end, step, call, ...)                     \
			A3D_PP_INT_IF( step,                                                 \
				A3D_PP_RANGE_INNER_CALL_CMP,                                     \
				A3D_PP_RANGE_INNER_CALL_END)##(start, end, step, call, __VA_ARGS__)    

//return directly
#define A3D_PP_RANGE_INNER_CALL_END(...)

//if(start < end) 
//   call A3D_PP_RANGE_INNER_CALL_SMALL_TO_BIG(...)
//else        
//   call A3D_PP_RANGE_INNER_CALL_BIG_TO_SMALL(...)
#define A3D_PP_RANGE_INNER_CALL_CMP(start, end, step, call, ...)                      \
			A3D_PP_IF( A3D_PP_LESS(start, end),                                 \
				A3D_PP_RANGE_INNER_CALL_SMALL_TO_BIG,                                 \
				A3D_PP_RANGE_INNER_CALL_BIG_TO_SMALL)##(start, end, step, call, __VA_ARGS__)  \

// do small to  big loop
#define A3D_PP_RANGE_INNER_CALL_SMALL_TO_BIG(start, end, step, call, ...)                 \
			A3D_PP_RANGE_INNER_CALL_CHECK_STEP(A3D_PP_SUB(end, start),                    \
				start, step, call, A3D_PP_ADD, __VA_ARGS__ )

// do big to small loop
#define A3D_PP_RANGE_INNER_CALL_BIG_TO_SMALL(start, end, step, call, ...)                 \
			A3D_PP_RANGE_INNER_CALL_CHECK_STEP( A3D_PP_SUB(start, end),                   \
				start, step, call, A3D_PP_SUB, __VA_ARGS__ )

// check step
// if(step ==1) 
//    start loop
// else
//    do count = count/step
#define A3D_PP_RANGE_INNER_CALL_CHECK_STEP(count, N, step, call, op, ...) \
			A3D_PP_IF(A3D_PP_SUB1(step),                                  \
				A3D_PP_RANGE_INNER_CALL_DIV_STEP,                         \
				A3D_PP_RANGE_INNER_CALL_LOOP_START)##(                    \
					count, N, step, call, op, __VA_ARGS__)

// step not 1, count = count / step
#define A3D_PP_RANGE_INNER_CALL_DIV_STEP(count, N, step, call, op, ...)  \
			A3D_PP_RANGE_INNER_CALL_DIV_STEP_HELPER(A3D_PP_DIV(count,step), N, step, call, op, __VA_ARGS__)
// evalute div
#define A3D_PP_RANGE_INNER_CALL_DIV_STEP_HELPER(count, N, step, call, op, ...) \
			A3D_PP_RANGE_INNER_CALL_LOOP_START(count, N, step, call, op, __VA_ARGS__)

// start loop
#define A3D_PP_RANGE_INNER_CALL_LOOP_START(count, N, step, call, op, ...) \
			A3D_PP_RANGE_INNER_CALL_LOOP##count##(N, step, call, op, __VA_ARGS__)

#define A3D_PP_RANGE_INNER_CALL_CONNECT(x, y) A3D_PP_RANGE_INNER_CALL_CONNECT_STEP(x##y)
#define A3D_PP_RANGE_INNER_CALL_CONNECT_STEP(result ) result

#define A3D_PP_RANGE_INNER_CALL_LOOP0(N, step, call, op, ...)   A3D_PP_RANGE_INNER_CALL_CONNECT(call,(N, 0, __VA_ARGS__))
#define A3D_PP_RANGE_INNER_CALL_LOOP1(N, step, call, op, ...)   A3D_PP_RANGE_INNER_CALL_CONNECT(call,(N, 1, __VA_ARGS__))  A3D_PP_RANGE_INNER_CALL_LOOP0( op(N, step), step, call, op, __VA_ARGS__)
